  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #ffe49c; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Hungary's Golden Team remained largely intact until the failed [[Hungarian Revolution of 1956]], except that coach Sebes was replaced with Bukovi in early 1956. After the revolution, Puskás, Czibor and Kocsis emigrated and, ultimately, continued their careers in Spain, playing for [[Real Madrid]] (Puskás) and [[FC Barcelona]] (Czibor and Kocsis), respectively. At the [[1958 FIFA World Cup]], only four players from the Mighty Magyars still featured - Bozsik, Budai, Grosics, Hidegkuti - but were unable to repeat earlier success. &lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Hungary's Golden Team remained largely intact until the failed [[Hungarian Revolution of 1956]], except that coach Sebes was replaced with Bukovi in early 1956. After the revolution, Puskás, Czibor and Kocsis emigrated and, ultimately, continued their careers in Spain, playing for [[Real Madrid]] (Puskás) and [[FC Barcelona]] (Czibor and Kocsis), respectively. At the [[1958 FIFA World Cup]], only four players from the Mighty Magyars still featured - Bozsik, Budai, Grosics, Hidegkuti - but were unable to repeat earlier success. &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;In the 1960s and beyond, Hidegkuti, Puskás, and central defender [[Gyula Lóránt]] became prominent international coaches, managing clubs such as [[Panathinaikos F.C.]] (Puskás), [[ACF Fiorentina]] (Hidegkuti), and [[FC Bayern Munich]] (Lóránt). Lóránt's admission to the [[German Sport University Cologne]] was arranged by Herberger.&amp;lt;ref&amp;gt;{{cite web|title=Er entdeckte den totalen Fussball&quot;|author=Gyula Lóránt|work=DER SPIEGEL|date=18 March 1977|url=http://www.spiegel.de/spiegel/print/d-40941673.html |accessdate=13 December 2016 | language=German}}&amp;lt;/ref&amp;gt; Several other Golden Team members had success as coaches in the domestic [[Nemzeti Bajnokság I|Hungarian league]].&lt;/ins&gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
