  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;The West German players became instantaneously famous in Germany as the ''Heroes of Bern''.{{sfn|Heinrich|2004|pp=87-94}} Several received lucrative offers to play abroad, but none accepted, continuing instead as semi-amateurs in German clubs. Herberger overhauled the national team after the tournament. Hence, of the winning 1954 side, only Eckel, Rahn, Schäfer, and a 37-year old Fritz Walter still played at the 1958 World Cup, reaching the semifinals. Few of the 1954 World Champions went into coaching; an exception is Liebrich, who is credited with saving his home club Kaiserslautern from [[Bundesliga]] relegation in 1965. Some players had difficulties to cope with fame, and struggled at times with economic problems and alcoholism.&amp;lt;ref&amp;gt;{{cite web |url=http://www.das-wunder-von-bern.de/helden_rahn.htm|title=Helmut Rahn: der Boss|publisher=das-wunder-von-bern.de|accessdate=13 December 2016|language=German}}&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;{{cite web |url=http://www.das-wunder-von-bern.de/helden_kohlmeyer.htm|title=Werner Kohlmeyer: Fussballer &amp;amp; Leichtathlet|publisher=das-wunder-von-bern.de|accessdate=13 December 2016|language=German}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
