  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #ffe49c; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;[[Digestion]] is carried out internally and externally. Spiders&lt;del class=&quot;diffchange diffchange-inline&quot;&gt; that&lt;/del&gt; do not have powerful chelicerae, but secrete digestive fluids into their prey from a series of ducts perforating their chelicerae. The coxal glands are excretory organs that lie in the prosoma, and open to the outside at the coxae of the walking legs. In primitive spiders, such as the [[Mesothelae]] and the [[Mygalomorphae]], two pairs of coxal glands open onto the posterior side of the first and third coxae. They release a fluid only during feeding and play an important role in ion and water balance.{{sfnp|Foelix|1996|p=52}} Digestive fluids dissolve the prey's internal tissues. Then the spider feeds by sucking the partially digested fluids out. Other spiders with more powerfully built chelicerae masticate the entire body of their prey and leave behind only a relatively small amount of indigestible materials. Spiders consume only liquid foods. Many spiders will store prey temporarily. Web weaving spiders that have made a shroud of silk to quiet their envenomed prey's death struggles will generally leave them in these shrouds and then consume them at their leisure.&lt;/div&gt;&lt;/td&gt;
