  &lt;td colspan=&quot;2&quot; class=&quot;diff-lineno&quot;&gt;Line 68:&lt;/td&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-lineno&quot;&gt;Line 68:&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;London: Harrison and Sons, 1871: pg.6&amp;lt;/ref&amp;gt; He was one of the few kings who could read the [[cuneiform script]] in [[Akkadian language|Akkadian]] and [[Sumerian language|Sumerian]], and claimed that he even read texts from before the [[Utnapishtim|great flood]]. He was also able to solve mathematical problems. During his reign, he collected cuneiform texts from all over [[Mesopotamia]], especially [[Babylonia]], in the [[Library of Ashurbanipal|library of Nineveh]].&amp;lt;ref name=&quot;M. Roaf 2004, p. 191&quot;&amp;gt;{{cite book|first=M.|last= Roaf|title= Cultural Atlas of Mesopotamia and the Ancient Near East |year=2004|page= 191}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;London: Harrison and Sons, 1871: pg.6&amp;lt;/ref&amp;gt; He was one of the few kings who could read the [[cuneiform script]] in [[Akkadian language|Akkadian]] and [[Sumerian language|Sumerian]], and claimed that he even read texts from before the [[Utnapishtim|great flood]]. He was also able to solve mathematical problems. During his reign, he collected cuneiform texts from all over [[Mesopotamia]], especially [[Babylonia]], in the [[Library of Ashurbanipal|library of Nineveh]].&amp;lt;ref name=&quot;M. Roaf 2004, p. 191&quot;&amp;gt;{{cite book|first=M.|last= Roaf|title= Cultural Atlas of Mesopotamia and the Ancient Near East |year=2004|page= 191}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;−&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #ffe49c; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Nineveh was the capital city of Assyria from the 9th–7th centuries BC, but had been destroyed in 612 BC. Ashurbanipal’s palace in the Nineveh was re-excavated in December 1853. The library was discovered in the Lion-Hunt Room (Murray, 2009).&amp;lt;ref name=Book&amp;gt;{{cite book|last=Murray|first=Stuart|title=The Library: An Illustrated History|year=2009|publisher=Skyhorse Publishing|location=New York, NY|isbn=9780838909911|pages=3–10}}&amp;lt;/ref&amp;gt; The [[Library of Ashurbanipal]] at Nineveh is perhaps the most compelling discovery in the Ancient Near East (despite how&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;, unfortunately,&lt;/del&gt; the British discoverers kept no record of their findings from different sites &quot;and soon after reaching Europe, the tablets appeared to have been irreparably mixed with each other and with tablets originating from other sites&quot;, see: [[Library of Ashurbanipal]] 1, Discovery). There have been over 30,000 clay tablets and fragments uncovered in Ashurbanipal’s library,&amp;lt;ref&amp;gt;https://www.britishmuseum.org/research/research_projects/ashurbanipal_library_phase_1.aspx &quot;Assurbanipal Library Phase 1&quot;, British Museum One&amp;lt;/ref&amp;gt; providing archaeologists with an amazing wealth of Mesopotamian literary, religious and administrative work.&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Nineveh was the capital city of Assyria from the 9th–7th centuries BC, but had been destroyed in 612 BC. Ashurbanipal’s palace in the Nineveh was re-excavated in December 1853. The library was discovered in the Lion-Hunt Room (Murray, 2009).&amp;lt;ref name=Book&amp;gt;{{cite book|last=Murray|first=Stuart|title=The Library: An Illustrated History|year=2009|publisher=Skyhorse Publishing|location=New York, NY|isbn=9780838909911|pages=3–10}}&amp;lt;/ref&amp;gt; The [[Library of Ashurbanipal]] at Nineveh is perhaps the most compelling discovery in the Ancient Near East (despite how the British discoverers kept no record of their findings from different sites &quot;and soon after reaching Europe, the tablets appeared to have been irreparably mixed with each other and with tablets originating from other sites&quot;, see: [[Library of Ashurbanipal]] 1, Discovery). There have been over 30,000 clay tablets and fragments uncovered in Ashurbanipal’s library,&amp;lt;ref&amp;gt;https://www.britishmuseum.org/research/research_projects/ashurbanipal_library_phase_1.aspx &quot;Assurbanipal Library Phase 1&quot;, British Museum One&amp;lt;/ref&amp;gt; providing archaeologists with an amazing wealth of Mesopotamian literary, religious and administrative work.&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Those clay tablets were written in cuneiform, which derives from the Latin word “cunea” which means “wedge” in English, because it is created by making wedges on clay tablets. The Assurbanipal Library in Nineveh was a royal library, and the first library to classify their collection according to genres.  Four-sided tablets were utilized for financial transactions and two-sided clay tablets were reserved for agricultural records (Murray, 2009).&amp;lt;ref name=Book /&amp;gt;   Among the findings was the [[Enuma Elish]], also known as ''the Epic of Creation,''&amp;lt;ref&amp;gt;Epic of Creation in [[Stephanie Dalley|Dalley, Stephanie]]. ''Myths from Mesopotamia.'' Oxford, 1989: pg.233-81&amp;lt;/ref&amp;gt; which depicts a traditional Babylonian view of creation where the god Marduk slays [[Tiamat]], the personification of salt water, and creates the world from her body. In this particular version, man is created from the blood of a revolting god, [[Qingu]], in order to toil on behalf of the gods. Also found in Nineveh, The [[Epic of Gilgamesh]]&amp;lt;ref&amp;gt;Epic of Gilgamesh in Dalley, Stephanie. ''Myths from Mesopotamia.'' Oxford, 1989: pg.50–135&amp;lt;/ref&amp;gt;  is a compelling account of the hero and his friend Enkidu seeking out to destroy the demon [[Humbaba]]. The Gods punished the pair for their arrogance, however, by having Enkidu die from an illness. After Enkidu’s death, Gilgamesh seeks [[Utnapishtim]], the survivor of the [[Deluge myth|Deluge]], in order to find out the secret of immortality. Also the Annals of Ashurbanipal were found here. The annals of Ashurbanipal were detailed, almost novelistic accounts of his military and civic achievements.&amp;lt;ref&amp;gt;{{Cite book|title = Worlds Together Worlds Apart|last = Pollard|first = Elizabeth|publisher = W.W. Norton &amp;amp; Company|year = 2015|isbn = 978-0-393-92207-3|location = |pages = 130}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Those clay tablets were written in cuneiform, which derives from the Latin word “cunea” which means “wedge” in English, because it is created by making wedges on clay tablets. The Assurbanipal Library in Nineveh was a royal library, and the first library to classify their collection according to genres.  Four-sided tablets were utilized for financial transactions and two-sided clay tablets were reserved for agricultural records (Murray, 2009).&amp;lt;ref name=Book /&amp;gt;   Among the findings was the [[Enuma Elish]], also known as ''the Epic of Creation,''&amp;lt;ref&amp;gt;Epic of Creation in [[Stephanie Dalley|Dalley, Stephanie]]. ''Myths from Mesopotamia.'' Oxford, 1989: pg.233-81&amp;lt;/ref&amp;gt; which depicts a traditional Babylonian view of creation where the god Marduk slays [[Tiamat]], the personification of salt water, and creates the world from her body. In this particular version, man is created from the blood of a revolting god, [[Qingu]], in order to toil on behalf of the gods. Also found in Nineveh, The [[Epic of Gilgamesh]]&amp;lt;ref&amp;gt;Epic of Gilgamesh in Dalley, Stephanie. ''Myths from Mesopotamia.'' Oxford, 1989: pg.50–135&amp;lt;/ref&amp;gt;  is a compelling account of the hero and his friend Enkidu seeking out to destroy the demon [[Humbaba]]. The Gods punished the pair for their arrogance, however, by having Enkidu die from an illness. After Enkidu’s death, Gilgamesh seeks [[Utnapishtim]], the survivor of the [[Deluge myth|Deluge]], in order to find out the secret of immortality. Also the Annals of Ashurbanipal were found here. The annals of Ashurbanipal were detailed, almost novelistic accounts of his military and civic achievements.&amp;lt;ref&amp;gt;{{Cite book|title = Worlds Together Worlds Apart|last = Pollard|first = Elizabeth|publisher = W.W. Norton &amp;amp; Company|year = 2015|isbn = 978-0-393-92207-3|location = |pages = 130}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;

