		<summary type="html">&lt;p&gt;‎&lt;span dir=&quot;auto&quot;&gt;&lt;span class=&quot;autocomment&quot;&gt;History: &lt;/span&gt; Moving from &lt;a href=&quot;/wiki/Larry_Goodman&quot; title=&quot;Larry Goodman&quot;&gt;Larry Goodman&lt;/a&gt; page per &lt;a href=&quot;/wiki/Wikipedia:UNDUE&quot; class=&quot;mw-redirect&quot; title=&quot;Wikipedia:UNDUE&quot;&gt;WP:UNDUE&lt;/a&gt; as is, feel free to trim here if necessary.&lt;/span&gt;&lt;/p&gt;
&lt;table class=&quot;diff diff-contentalign-left&quot; data-mw=&quot;interface&quot;&gt;
