&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On 25 July, 2016, the company acquired The Sandwich Factory Holdings Ltd for £15m from [[Cranswick plc]].&amp;lt;ref&amp;gt;http://www.greencore.com/greencore-announces-15m-bolt-on-acquisition-in-uk-food-to-go/&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;http://www.foodmanufacture.co.uk/Business-News/Food-manufacturer-acquires-sandwich-business-for-15M&amp;lt;/ref&amp;gt; On 14 November 2016, Greencore announced it would acquire US Based [[Peacock Foods]] for $747.5m, significantly expanding its presence in the country.&amp;lt;ref&amp;gt;https://www.ft.com/content/f643624e-aa41-11e6-a0bb-97f42551dbf4&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On 25 July, 2016, the company acquired The Sandwich Factory Holdings Ltd for £15m from [[Cranswick plc]].&amp;lt;ref&amp;gt;http://www.greencore.com/greencore-announces-15m-bolt-on-acquisition-in-uk-food-to-go/&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;http://www.foodmanufacture.co.uk/Business-News/Food-manufacturer-acquires-sandwich-business-for-15M&amp;lt;/ref&amp;gt; On 14 November 2016, Greencore announced it would acquire US Based [[Peacock Foods]] for $747.5m, significantly expanding its presence in the country.&amp;lt;ref&amp;gt;https://www.ft.com/content/f643624e-aa41-11e6-a0bb-97f42551dbf4&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;===1989 investigation===&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;In January 1989 it emerged that [[Larry Goodman]], through his company Food Industries, was interested in making a &quot;significant investment&quot; in the [[Irish Sugar]] Company and confirmed that it had approached the company and the Government about its plans. The chief executive of [[Food Industries]], [[David Dilger]], said the company had not received &quot;a negative or positive&quot; response from the Government – which then commissioned a study on the future development of Irish Sugar. Dilger said on radio in February 1989 that he had been in touch Irish Sugar two months earlier. Following this Dilger and Goodman made a presentation to senior officials from [[ICTU]] on their plans for Irish Sugar. {{citation needed|date=March 2014}}&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On 14 February 1989 the chairman of the Oireachtas Joint Committee on commercial State-Sponsored bodies, [[Liam Lawlor]], failed to attend a private meeting of the committee at which Opposition members planned to question him about a report on the Irish Sugar Company's affairs, submitted by the company to the committee.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0215/Pg001.html &quot;FF TD fails to attend meeting on Irish Sugar&quot;], Dick Walsh, ''[[Irish Times]]'', 15 February 1989.&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;It emerged that as Chairman of the committee Lawlor had received a report written by Irish Sugar for the committee in November 1988, but had not shared it with other members of the committee. Although at first he denied he knew of the existence of the document, he later admitted he had, though he reportedly &quot;had not read its contents&quot;.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0217/Pg015.html 1989 Profile], irishtimes.com; accessed 22 March 2014.&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0222/Pg001.html 1989 Profile], irishtimes.com; accessed 22 March 2014.&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;The report &quot;spelled out in greater detail than ever before the structures, financial condition and prospects&quot; of Irish Sugar.&amp;lt;ref&amp;gt;http://www.irishtimes.com/newspaper/archive/1989/0215/Pg001.html&amp;lt;/ref&amp;gt; At the time Lawlor was a non-executive director of Food Industries, in which Goodman had a majority stake. Lawlor owned 11,000 shares in the company at the time valued at £31,000. He was appointed non-executive director in 1987, given his &quot;expertise in the refrigeration/cold storage business&quot;.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0217/Pg015.html]&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Lawlor's involvement with Food Industries led to allegations of a conflict of interest, and proposals from the [[Labour Party (Ireland)|Labour]] and [[Workers' Party of Ireland|Workers parties]] for the drawing up of a code of conduct and declaration of interests via amendment to standing orders of the Dáil.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0217/Pg015.htm]&amp;lt;/ref&amp;gt; Labour Party leader [[Dick Spring]] was ordered to leave the Dáil after persistent questioning about Lawlor's behaviour.&amp;lt;ref&amp;gt;[http://oireachtasdebates.oireachtas.ie/debates%20authoring/debateswebpack.nsf/takes/dail1989021600003?opendocument]&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td colspan=&quot;2&quot; class=&quot;diff-empty&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Lawlor resigned as chairman of the committee on 16 February 1989.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0217/Pg001.html]&amp;lt;/ref&amp;gt; [[Des O'Malley]] welcomed the resignation, stating that &quot;it was the only honourable course open to him to protect and preserve the independence and the integrity of the committee&quot;.&amp;lt;ref&amp;gt;[http://www.irishtimes.com/newspaper/archive/1989/0217/Pg008.html 1989 Profile], irishtimes.com; accessed 22 March 2014.&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;==Operations==&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;==Operations==&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;

