  &lt;td class=&quot;diff-marker&quot;&gt;−&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #ffe49c; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Oncillas are typically distributed from [[Costa Rica]] through Northern [[&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;Argentina&lt;/del&gt;]], and show a strong preference for [[cloud forest|montane forest]]. They are usually found in elevations higher than those of the margay or ocelot. They have been found in habitats as high as 4500m in [[Colombia]], in the Andean highlands in [[Ecuador]] and [[Peru]], and in the subtropical forest highlands in [[Brazil]].&amp;lt;ref name=Mondolfi&amp;gt;{{cite book| author = Mondolfi, E., Hoogesteijn, R. | year = 1986 | chapter=Notes on the biology and status of the small wild cats in Venezuela |title= Miller, S. D., Everett, D. D. (eds.), ''Cats of the World: Biology, Conservation and Management'' |pages =125–146 |publisher=National Wildlife Federation |location= Washington, DC}}&amp;lt;/ref&amp;gt; They have also been identified in [[cerrado]] and scrubland environments.&amp;lt;ref name=WCoW/&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;Oncillas are typically distributed from [[Costa Rica]] through Northern [[&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Puebla&lt;/ins&gt;]], and show a strong preference for [[cloud forest|montane forest]]. They are usually found in elevations higher than those of the margay or ocelot. They have been found in habitats as high as 4500m in [[Colombia]], in the Andean highlands in [[Ecuador]] and [[Peru]], and in the subtropical forest highlands in [[Brazil]].&amp;lt;ref name=Mondolfi&amp;gt;{{cite book| author = Mondolfi, E., Hoogesteijn, R. | year = 1986 | chapter=Notes on the biology and status of the small wild cats in Venezuela |title= Miller, S. D., Everett, D. D. (eds.), ''Cats of the World: Biology, Conservation and Management'' |pages =125–146 |publisher=National Wildlife Federation |location= Washington, DC}}&amp;lt;/ref&amp;gt; They have also been identified in [[cerrado]] and scrubland environments.&amp;lt;ref name=WCoW/&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
