&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;They have been recorded in northern [[Panama]], but the remainder of the country appears to be a gap in the range of the species.&amp;lt;ref name=Nowell&amp;gt;{{cite book| author=Nowell, K., Jackson, P. |year=1996 | title=The Wild Cats: A Status Survey and Conservation Action Plan |publisher=IUCN |location=Gland |url=http://www.catsg.org/catsgportal/cat-website/catfolk/tigrin01.htm}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;They have been recorded in northern [[Panama]], but the remainder of the country appears to be a gap in the range of the species.&amp;lt;ref name=Nowell&amp;gt;{{cite book| author=Nowell, K., Jackson, P. |year=1996 | title=The Wild Cats: A Status Survey and Conservation Action Plan |publisher=IUCN |location=Gland |url=http://www.catsg.org/catsgportal/cat-website/catfolk/tigrin01.htm}}&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
