&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;&amp;#160;&lt;/td&gt;
  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On December 5, 2016 Smith performed &quot;People Have the Power&quot; at Riverside Church, Manhattan, to celebrate the 20th anniversary of Democracy Now. She was joined by Michael Stipe.&lt;/div&gt;&lt;/td&gt;
