  &lt;td style=&quot;background-color: #f9f9f9; color: #333333; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #e6e6e6; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;/td&gt;
&lt;/tr&gt;
&lt;tr&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;−&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #ffe49c; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On December 10, 2016, Smith &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;accepted&lt;/del&gt; the [[Nobel Prize &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;for&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;Literature&lt;/del&gt;]] on behalf of [[Bob Dylan]], who himself could not &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;attend&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;the&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;ceremony&lt;/del&gt;. &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;During&lt;/del&gt; the &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;assembly&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;in&lt;/del&gt; [[&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;Stockholm&lt;/del&gt;]] Smith sang the Dylan song [[A Hard Rain's a-Gonna Fall]]. Overcome by nerves she forgot the words to the second verse, but after a brief apology, &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;which&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;drew&lt;/del&gt; applause from the audience, she resumed the song &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;and&lt;/del&gt; earned a &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;great&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;ovation&lt;/del&gt; at the end.&amp;lt;ref&amp;gt;[http://www.newyorker.com/culture/cultural-comment/a-transcendent-patti-smith-accepts-bob-dylans-nobel-prize A Transcendent Patti Smith Accepts Bob Dylan’s Nobel Prize]&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;[&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;https&lt;/del&gt;://www.&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;youtube&lt;/del&gt;.com/&lt;del class=&quot;diffchange diffchange-inline&quot;&gt;watch?v=_2SPNT1lwBg&lt;/del&gt; Patti Smith &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;-&lt;/del&gt; &lt;del class=&quot;diffchange diffchange-inline&quot;&gt;A&lt;/del&gt; Hard Rain's A-Gonna Fall&lt;del class=&quot;diffchange diffchange-inline&quot;&gt; (Bob Dylan Cover)&lt;/del&gt; at&lt;del class=&quot;diffchange diffchange-inline&quot;&gt; 2016&lt;/del&gt; Nobel&lt;del class=&quot;diffchange diffchange-inline&quot;&gt; Prize Award&lt;/del&gt; Ceremony]&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
  &lt;td class=&quot;diff-marker&quot;&gt;+&lt;/td&gt;
  &lt;td style=&quot;color:black; font-size: 88%; border-style: solid; border-width: 1px 1px 1px 4px; border-radius: 0.33em; border-color: #a3d3ff; vertical-align: top; white-space: pre-wrap;&quot;&gt;&lt;div&gt;On December 10, 2016, Smith &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;attended&lt;/ins&gt; the [[Nobel Prize&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;]]&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Award&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Ceremony in [[Stockholm&lt;/ins&gt;]] on behalf of [[Bob Dylan&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;]], winner of the [[Nobel Prize in Literature&lt;/ins&gt;]], who himself could not &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;be&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;present&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;due to prior commitments&lt;/ins&gt;. &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;After&lt;/ins&gt; the &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;official&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;presentation speech for the literary prize by&lt;/ins&gt; [[&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Horace Engdahl&lt;/ins&gt;]]&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;, member of the [[Swedish Academy]],&lt;/ins&gt; Smith sang the Dylan song [[A Hard Rain's a-Gonna Fall]]. Overcome by nerves she forgot the words to the second verse, but after a brief apology, &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;and an&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;encouraging&lt;/ins&gt; applause from the audience, she resumed the song&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;,&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;which&lt;/ins&gt; earned&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt; her&lt;/ins&gt; a &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;jubilant&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;applause&lt;/ins&gt; at the end.&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt; &lt;/ins&gt;&amp;lt;ref&amp;gt;[http://www.newyorker.com/culture/cultural-comment/a-transcendent-patti-smith-accepts-bob-dylans-nobel-prize A Transcendent Patti Smith Accepts Bob Dylan’s Nobel Prize]&amp;lt;/ref&amp;gt;&amp;lt;ref&amp;gt;[&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;http&lt;/ins&gt;://www.&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;rollingstone&lt;/ins&gt;.com/&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;music/news/patti-smith-covers-bob-dylans-hard-rain-at-nobel-ceremony-w455069 See&lt;/ins&gt; Patti Smith &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Cover&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Bob&lt;/ins&gt; &lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;Dylan's '&lt;/ins&gt;Hard Rain's A-Gonna Fall&lt;ins class=&quot;diffchange diffchange-inline&quot;&gt;'&lt;/ins&gt; at Nobel Ceremony]&amp;lt;/ref&amp;gt;&lt;/div&gt;&lt;/td&gt;
&lt;/tr&gt;
